  const newArr = arr.filter((ele) => ele.location === city).map((ele) => {
    for (const student in gradeArr) {
      if (student.studentId === ele.id) {
        ele.grade = student.grade;
      }
    }
    if (!ele.grade) {
      ele.grade = 'N/A';
    }
  });

  return newArr;
}

